import React from 'react'
import {useState} from 'react'

function App() {

  const[id, setId] =useState('');
  const[password, setPassword] = useState('');

  return (
    <div>
      아이디 : <input type="id" value={id} onChange={(event)=>setId(event.target.value)}/><br/>
      비밀번호 : <input type="password" value={password} onChange={(event)=>setPassword(event.target.value)}/><br/>
      <input type="button" value='로그인'onClick={()=>alert({id})}/>
    </div>
  )
}

export default App
